import React, { useState } from 'react';
import axios from 'axios';
import { BarChart, Bar, XAxis, YAxis, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function Home() {
  const [search, setSearch] = useState('');
  const [selectedFoods, setFoods] = useState([]);

  const handleSearch = async () => {
    const res = await axios.post('http://localhost:5000/nutrients', {
      food: search.toLowerCase(), quantity: 1
    });
    setFoods([...selectedFoods, res.data]);
  };

  return (
    <div>
      <div className="hero">
        <h1>Track Your Nutrition in Real Time</h1>
      </div>

      <div className="search-section">
        <input value={search} onChange={e => setSearch(e.target.value)} placeholder="e.g. Avocado" />
        <button onClick={handleSearch}>Search</button>
      </div>

      <div className="food-grid">
        {selectedFoods.map((f, i) => (
          <div key={i} className="food-card">
            <img src={`/images/${f.food}.jpg`} alt={f.food} />
            <h3>{f.food}</h3>
            <p>Calories: {f.calories}</p>
            <p>Protein: {f.protein}g</p>
            <p>Carbs: {f.carbs}g</p>
            <p>Fat: {f.fat}g</p>
          </div>
        ))}
      </div>

      <div style={{ width: '100%', height: 300 }}>
        <ResponsiveContainer>
          <BarChart data={selectedFoods}>
            <XAxis dataKey="food" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="protein" fill="#82ca9d" />
            <Bar dataKey="carbs" fill="#ffc658" />
            <Bar dataKey="fat" fill="#ff8042" />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}

export default Home;
